INSERT INTO `cat_jdownloads_templates` (`id`, `template_name`, `template_typ`, `template_header_text`, `template_subheader_text`, `template_footer_text`, `template_text`, `template_active`, `locked`, `note`, `cols`, `checkbox_off`, `symbol_off`, `jlanguage`, `checked_out`, `checked_out_time`) VALUES
